import React from 'react';
import getData from '../util/getData.js';

export default class Employment extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            employment:{},
            loaded:false
        }
    }

    render(){
        const {employment, loaded, } = this.state;

        if(!loaded) return (<div>Employment Loading...</div>);

        return(
            <div style={{paddingTop:"25px"}}>
                <div className='subTitle'><h2>{employment.introduction.title}</h2></div>
                <div className='degreeList'>

                    {/* Degree Statistics Section  */}
                            {
                                employment.introduction.content.map((p) =>
                                    <div className='contentHolder'>
                                        <h4 className='contentTitle'>{p.title}</h4>
                                        <p className='sectionContent'>{p.description}</p>
                                    </div>
                                )
                            }
                        <section id="degreeStatistics"> 

                            <div className="subTitle"><h2>Degree Statistics</h2></div>

                            {
                                employment.degreeStatistics.statistics.map((p) =>
                                    <div className='contentHolder'>
                                      <h4 className='contentTitle'>{employment.degreeStatistics.title}</h4>
                                        <p className='sectionContent'>{p.value}</p>
                                        <p className='sectionContent'>{p.description}</p>
                                    </div>

                                )
                            }
                        </section>
                    {/* Employers Section  */}
                        <section id="employerSection"> 
                            <div className="subTitle"><h2>{employment.employers.title}</h2></div>
                            {
                                employment.employers.employerNames.map((p) =>
                                    <div className='contentHolder'>
                                        <h4 className='contentTitle'>{p}</h4>
                                    </div>
                                )
                            }
                        </section>

                    {/* Careers Section  */}
                        <section id="careers"> 
                            <div className="subTitle"><h2>{employment.careers.title}</h2></div>
                            {
                                employment.careers.careerNames.map((p) =>
                                    <div className='contentHolder'>
                                        <h4 className='contentTitle'>{p}</h4>
                                    </div>
                                )
                            }
                        </section>     

                    {/* Coop Table Section  */}
                        <section id="coopTable"> 
                            <div className="subTitle"><h2>{employment.coopTable.title}</h2></div>
                            <h3>CoopTable</h3>
                            {/* {
                                employment.careers.careerNames.map((p) =>
                                    <div>
                                        <h1>{p}</h1>
                                    </div>
                                )
                            } */}
                        </section>     

                    {/* Employer Table Section  */}
                        <section id="employmentTable"> 
                            <div className="subTitle"><h2>{employment.employmentTable.title}</h2></div>
                            <h3>EmploymentTable</h3>
                            <h3>EmploymentTable</h3>
                            <h3>EmploymentTable</h3>
                            <h3>EmploymentTable</h3>
                            <h3>EmploymentTable</h3>
                            {/* {
                                employment.careers.careerNames.map((p) =>
                                    <div>
                                        <h1>{p}</h1>
                                    </div>
                                )
                            } */}
                        </section>   

                    {/* Employer Map Section  */}
                        <section id="employerMap"> 
                            <div className="subTitle"><h2>Employer Map</h2></div>
                            {/* {
                                employment.careers.careerNames.map((p) =>
                                    <div>
                                        <h1>{p}</h1>
                                    </div>
                                )
                            } */}
                        </section> 
                </div>
            </div>
        )
    }

    componentDidMount(){
        getData('employment/')
            .then((json) => {
                this.setState({
                    employment:json,
                    loaded:true,
                    danTest:5
                });
            });
    }
}
